import React from 'react'
import { v4 as uuidv4 } from 'uuid';
const todos =[
    {
        'id' : uuidv4(),
        "title" : "Titas",
        "desc" : " Titas a name of River"
    },
    {
        'id': uuidv4(),
        "title" : "Megna",
        "desc" : " People called Megna is mother of Titash"
    },
    {
        'id':uuidv4(),
        "title" : "Padma",
        "desc" : " Padma is biggest river of Bangladesh "
    }
    
]


function List() {
  return (
    <div>
        {todos.map((todo)=>{
            const {id,title,desc} = todo;
            return(
                <div key={todo.id}>
                    <h1>{todo.title}</h1>
                    <p>{todo.desc}</p>
                </div>
            )
        })}
    </div>
  )
}

export default List
